// src/Dashboard.js
import React from 'react';
// import './Dashboard.css'; // Optional: Add a separate CSS file for styles

const Dashboard = () => {
  return (
    <div style={{ display: 'flex', height: '100vh' }}>
      {/* Side Menu */}
      <aside style={{ width: '250px', backgroundColor: '#2c3e50', color: '#ecf0f1', padding: '20px' }}>
        <h3>Menu</h3>
        <ul style={{ listStyleType: 'none', padding: 0 }}>
          <li style={{ margin: '10px 0' }}><a href="#" style={{ color: 'inherit', textDecoration: 'none' }}>Home</a></li>
          <li style={{ margin: '10px 0' }}><a href="#" style={{ color: 'inherit', textDecoration: 'none' }}>Cars</a></li>
          <li style={{ margin: '10px 0' }}><a href="#" style={{ color: 'inherit', textDecoration: 'none' }}>Profile</a></li>
          <li style={{ margin: '10px 0' }}><a href="#" style={{ color: 'inherit', textDecoration: 'none' }}>Settings</a></li>
        </ul>
      </aside>

      {/* Main Content */}
      <div style={{ flex: 1, padding: '20px' }}>
        {/* Top Menu */}
        <header style={{ padding: '10px 0', borderBottom: '1px solid #ddd', marginBottom: '20px' }}>
          <h2>Car Dashboard</h2>
        </header>

        {/* Dashboard Content */}
        <div style={{ textAlign: 'center' }}>
          <p>Welcome to your car management dashboard!</p>
          <p>Use the menu to navigate through different sections.</p>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
